#
# Structure for table "producto_preparados"
#

DROP TABLE IF EXISTS `producto_preparados`;
CREATE TABLE `producto_preparados` (
  `PRODUCTO_ID` int(11) NOT NULL,
  `PREPARADOS_ID` int(11) NOT NULL,
  `PRODUCTO_PREPARADOS_CANTIDADESCUENTO` float DEFAULT NULL,
  PRIMARY KEY (`PRODUCTO_ID`,`PREPARADOS_ID`),
  KEY `fk_producto_has_preparados_preparados1_idx` (`PREPARADOS_ID`),
  KEY `fk_producto_has_preparados_producto_idx` (`PRODUCTO_ID`),
  CONSTRAINT `fk_producto_has_preparados_preparados1` FOREIGN KEY (`PREPARADOS_ID`) REFERENCES `preparados` (`PREPARADOS_ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_producto_has_preparados_producto` FOREIGN KEY (`PRODUCTO_ID`) REFERENCES `producto` (`PRODUCTO_ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

